(function($, Drupal) {
  Drupal.behaviors.vidyard = {
      attach: function(context, settings) {
          class VideoPlayer {
              constructor()
              {
                  this.mp4Videos = document.querySelectorAll('video:not(.bnr-vdo)')
                  this.youtubeContainers = document.querySelectorAll('.mda-inline .youtube-player-container')
                  this.vimeoContainers = document.querySelectorAll('.mda-inline .vimeo-player-container')
                  this.mediaList = document.querySelectorAll('.mda-inline')
                  this.vidyardPlayers = VidyardV4.players
                  this.youtubePlayers = []
                  this.vimeoPlayers = []
                  const options = {
                      root: null,
                      rootMargin: '0px',
                      threshold: 0.5
                  }
                  this.observer = new IntersectionObserver(this.handleIntersection.bind(this), options)
                  this.mediaList.forEach((media) => {
                      this.observer.observe(media)
                  })
                  this.initYoutubePlayers()
                  this.initVimeoPlayers()
                  this.attachEventListeners()
                  this.enablePlayIcons()
              }
              initYoutubePlayers()
              {
                  if (typeof YT === 'undefined' || typeof YT.Player === 'undefined')
                      return
                  this.youtubeContainers.forEach((container, index) => {
                      const videoId = container.getAttribute('data-video-id')
                      const player = new YT.Player(container, {
                          videoId
                      })
                      this.youtubePlayers.push(player)
                  })
              }
              initVimeoPlayers()
              {
                  this.vimeoContainers.forEach((container, index) => {
                      const iframe = container
                      if (iframe.src.includes('vimeo')) {
                          const player = new Vimeo.Player(iframe)
                          this.vimeoPlayers.push(player)
                      }
                  })
              }
              attachEventListeners()
              {
                  this.attachVidyardEventListeners()
                  this.attachYoutubeEventListeners()
                  this.attachMp4EventListeners()
                  this.attachVimeoEventListeners()
              }
              attachVidyardEventListeners()
              {
                  const vidyardPlay = document.querySelectorAll('.play-icon.inline-vidyard')
                  vidyardPlay.forEach((play, index) => {
                      play.addEventListener('click', (event) => {
                          play.closest('.mda-wpr').classList.add('playing')
                          if (this.vidyardPlayers[index])
                              this.vidyardPlayers[index].play()
                      })
                  })
              }
              attachYoutubeEventListeners()
              {
                  const linkVideoPlay = document.querySelectorAll('.play-icon.inline-youtube')
                  linkVideoPlay.forEach((play, index) => {
                      play.addEventListener('click', (event) => {
                          play.closest('.mda-wpr').classList.add('playing')
                          if (this.youtubePlayers[index])
                              this.youtubePlayers[index].playVideo()
                      })
                  })
              }
              attachMp4EventListeners()
              {
                  const fileVideoPlay = document.querySelectorAll('.play-icon.inline-mp4')
                  fileVideoPlay.forEach((play, index) => {
                      play.addEventListener('click', (event) => {
                          play.closest('.mda-wpr').classList.add('playing')
                          if (this.mp4Videos[index])
                              this.mp4Videos[index].play()
                      })
                  })
              }
              attachVimeoEventListeners()
              {
                  const vimeoPlay = document.querySelectorAll('.play-icon.inline-vimeo')
                  vimeoPlay.forEach((play, index) => {
                      play.addEventListener('click', (event) => {
                          play.closest('.mda-wpr').classList.add('playing')
                          if (this.vimeoPlayers[index])
                              this.vimeoPlayers[index].play()
                      })
                  })
              }
              pauseVidyardPlayers()
              {
                  if (this.vidyardPlayers)
                      this.vidyardPlayers.forEach((video) => {
                          video?.pause()
                      })
              }
              pauseYoutubePlayers()
              {
                  if (this.youtubePlayers)
                      this.youtubePlayers.forEach((video) => {
                          if (video.pauseVideo && typeof video.pauseVideo === 'function')
                              video.pauseVideo()
                      })
              }
              pauseMp4Videos()
              {
                  if (this.mp4Videos)
                      this.mp4Videos.forEach((video) => {
                          video?.pause()
                      })
              }
              pauseVimeoPlayers()
              {
                  if (this.vimeoPlayers)
                      this.vimeoPlayers.forEach((video) => {
                          if (!video.pause())
                              video.pause()
                      })
              }
              handleIntersection(entries)
              {
                  entries.forEach((entry, index) => {
                      if (!entry.isIntersecting) {
                          this.pauseVidyardPlayers()
                          this.pauseYoutubePlayers()
                          this.pauseMp4Videos()
                          this.pauseVimeoPlayers()
                      }
                  })
              }
              enablePlayIcons()
              {
                  document.querySelectorAll('.play-icon').forEach((playIcon) => {
                      setTimeout(() => {
                          playIcon.classList.remove('disable')
                      }, 300)
                  })
              }
          }
          window.onVidyardAPI = (vidyardEmbed) => {
              vidyardEmbed.api.addReadyListener((_, player) => {
                  return new VideoPlayer()
              })
          }
          window.addEventListener('load', function() {
              new VideoPlayer()
          })
      }
  }
})(jQuery, Drupal)
;
