(function($, Drupal) {
  Drupal.behaviors.gridSections = {
      attach: function(context, settings) {
          const sections = $('.in-sec-crd-grid', context)
          if (sections.length === 0)
              return
          const mobileBehavior=settings?.paragraphSettings?.mobileBehavior
          if (mobileBehavior == 'accordion')
              console.log('Mobile accordion', mobileBehavior)
          else {
              if (mobileBehavior == 'slider')
                  console.log('Mobile slider', mobileBehavior)
          }
          sections.each((j, section) => {
              section = $(section)
              const $cardTitles = section.find('.in-std-hdg > h5')
              const setMaxHeight = () => {
                  const isDesktop = window.matchMedia('(min-width: 768px)')
                  $cardTitles.height('auto')
                  if (isDesktop.matches)
                      setTimeout(() => {
                          let titleQueue = []
                          let maxInnerHeight = 0
                          let cumulatedSize = 0
                          $cardTitles.each((i, elem) => {
                              const $this = $(elem)
                              const column = $this.closest('.in-crd-col')
                              const row = column.closest('.row')
                              cumulatedSize += Math.ceil(column.outerWidth())
                              const titleInnerHeight = $this.innerHeight()
                              if (titleInnerHeight > maxInnerHeight)
                                  maxInnerHeight = titleInnerHeight
                              titleQueue.push($this)
                              if (cumulatedSize >= row.width()) {
                                  titleQueue.forEach((ele) => ele.css({
                                      height: maxInnerHeight
                                  }))
                                  cumulatedSize = 0
                                  maxInnerHeight = 0
                                  titleQueue = []
                              }
                          })
                          titleQueue.forEach((ele) => ele.css({
                              height: maxInnerHeight
                          }))
                      }, 300)
              }
              setMaxHeight()
              $(window, context).on('resize', setMaxHeight)
          })
      }
  }
})(jQuery, Drupal)
